import React from 'react';

const Interests = () => {
  return (
    <div className='interests'>
      <h3>Interests</h3>
      <p>
        Food expert. Music scholar. Reader. Internet fanatic. Bacon buff.
        Entrepreneur. Travel geek. Pop culture ninja. Coffee fanatic.
      </p>
    </div>
  );
};

export default Interests;
